import React, { useState } from 'react';
import BouncingBall from './LoadingPge.js/BouncingBall';

const App = () => {
  const [loading, setLoading] = useState(true);

  const handleAnimationFinish = () => {
    setLoading(false);
  };

  return (
    <div className="App">
      {loading ? (
        <BouncingBall onFinish={handleAnimationFinish} />
      ) : (
        <MainContent />
      )}
    </div>
  );
};

export default App;
